(lib.radio_set_combined_3 = function(mode,startPosition,loop,reversed) {
if (loop == null) { loop = true; }
if (reversed == null) { reversed = false; }
	var props = new Object();
	props.mode = mode;
	props.startPosition = startPosition;
	props.labels = {};
	props.loop = loop;
	props.reversed = reversed;
	cjs.MovieClip.apply(this,[props]);

	this.isSingleFrame = false;
	// timeline functions:
	this.frame_0 = function() {
		if(this.isSingleFrame) {
			return;
		}
		if(this.totalFrames == 1) {
			this.isSingleFrame = true;
		}
		const mc = this;
		
		createjs.Ticker.on("tick", checkChildrenReady);
		
		function checkChildrenReady() {
		    var allReady = true;
		    
		    mc.children.forEach(function(child) {
				if (!child.isReady) {
					allReady = false; 
				}        
		    });
		
		    if (allReady) {
		        initializeRadioButtons(); 
		        createjs.Ticker.off("tick", checkChildrenReady);
		    }
		}
		
		function initializeRadioButtons() {
		    mc.children.forEach(function(child) {
				child.on("click", function() {
					selectRadio(child.name);
				});        
		    });
		}
		
		function selectRadio(selectedRadioName) {
		    mc.children.forEach(function(child) {
				if (child.name === selectedRadioName) {
					child.clickRadio();
				} else {
					child.resetClickState();
				}
			
		    });
		}
		
		this.reset = function(){
		    mc.children.forEach(function(child){
				if (child.name && child.name.startsWith("radio_")) {
					child.resetClickState();
				}
		    });
		}
	}

	// actions tween:
	this.timeline.addTween(cjs.Tween.get(this).call(this.frame_0).wait(1));

	// Layer_1
	this.radio_2 = new lib.radio();
	this.radio_2.name = "radio_2";
	this.radio_2.setTransform(0.5,39.5);

	this.radio_1 = new lib.radio();
	this.radio_1.name = "radio_1";
	this.radio_1.setTransform(6.5,26.9,1,1,0,0,0,6,6.4);

	this.radio_0 = new lib.radio();
	this.radio_0.name = "radio_0";
	this.radio_0.setTransform(6.5,6.9,1,1,0,0,0,6,6.4);

	this.timeline.addTween(cjs.Tween.get({}).to({state:[{t:this.radio_0},{t:this.radio_1},{t:this.radio_2}]}).wait(1));

	this._renderFirstFrame();

}).prototype = getMCSymbolPrototype(lib.radio_set_combined_3, new cjs.Rectangle(-0.5,-0.5,15,54), null);


