(lib.timesheet_project_dropdown_combined = function(mode,startPosition,loop,reversed) {
if (loop == null) { loop = true; }
if (reversed == null) { reversed = false; }
	var props = new Object();
	props.mode = mode;
	props.startPosition = startPosition;
	props.labels = {};
	props.loop = loop;
	props.reversed = reversed;
	cjs.MovieClip.apply(this,[props]);

	this.isSingleFrame = false;
	// timeline functions:
	this.frame_0 = function() {
		if(this.isSingleFrame) {
			return;
		}
		if(this.totalFrames == 1) {
			this.isSingleFrame = true;
		}
		const root = exportRoot;
		const mc = this;
		const parent = this.parent;
		const project_codes = ["PROJ_BUS", "PROJ_DES", "PROJ_DEV", "PROJ_TRAIN", "PROJ_SUP"];
		const projHeight = 26.05;
		const startPos = mc.PROJ_BUS.y;
		var currentCode ="";
		var index = 0;
		
		this.getCurrentCode = function(){
			return currentCode;
		}
		
		
		this.getListOfProjects = function(){
			var tempList = [];
			mc.children.forEach(function(child){
				if(child.visible == true){
					tempList.push(child.name);
				}
			});
			return tempList;
		}
		
		this.deselectAllMenus = function() {
			mc.children.forEach(function(child) {
			   if (child.name) {
					   child.resetClickState();
				}
		   })
		}
		
		this.selectProjectCode = function(selectedRadioName) {
		     mc.children.forEach(function(child) {
		        if (child.name) {
		            if (child.name === selectedRadioName) {
		               child.clickProjectCode();
					   currentCode = child.name;
		            } else {
		                child.resetClickState();
		
		            }
		        }
		    });
		}
		
		function hideAllProjectCodes(){
			mc.children.forEach(function(child){
				child.visible = false;
			});
		}
		
		this.showProjectCodes = function(arr){
			hideAllProjectCodes();
			arr.forEach(function(element){
				mc[element].visible = true;		
			});
			reorderListItems();
		}
		
		this.hideProjectCode = function(str){	
			mc[str].visible = false;	
			reorderListItems();
		}
		
		this.addProjectCode = function(str){
			mc[str].visible = true;	
			reorderListItems();
		}
		
		function reorderListItems(){
			var tempList = [];
			mc.children.forEach(function(child){
				if(child.visible == true){
					tempList.push(child);
				}
			});
		
			for(var i = 0; i < tempList.length; i++){
				tempList[i].y = startPos + projHeight * i; 
			}
		}
		
		this.init = function(){
			mc.children.forEach(function(child){
				child.setProjectCode(project_codes[index]);
				if (child.name) {
					child.on("click", function() {
						const mcName = mc.name.split("_");
						const parentAbr = mcName[0] + "_" + mcName[1];
						mc.selectProjectCode(child.name);
		
						parent[parentAbr].text = child.name;
						parent.setTimesheetFields(parentAbr, child.name);
						parent.dropdown_invis.dispatchEvent("click");
						parent.clickRemainingFields(parentAbr);		
						
					});
				}
				index++;
			});
		}
	}

	// actions tween:
	this.timeline.addTween(cjs.Tween.get(this).call(this.frame_0).wait(1));

	// PROJ_SUP
	this.PROJ_SUP = new lib.timesheet_proj_dropdown();
	this.PROJ_SUP.name = "PROJ_SUP";
	this.PROJ_SUP.setTransform(87.15,116.85,1,1,0,0,0,80.4,9.9);

	this.timeline.addTween(cjs.Tween.get(this.PROJ_SUP).wait(1));

	// PROJ_TRAIN
	this.PROJ_TRAIN = new lib.timesheet_proj_dropdown();
	this.PROJ_TRAIN.name = "PROJ_TRAIN";
	this.PROJ_TRAIN.setTransform(87.15,91,1,1,0,0,0,80.4,9.9);

	this.timeline.addTween(cjs.Tween.get(this.PROJ_TRAIN).wait(1));

	// PROJ_DEV
	this.PROJ_DEV = new lib.timesheet_proj_dropdown();
	this.PROJ_DEV.name = "PROJ_DEV";
	this.PROJ_DEV.setTransform(87.15,64.85,1,1,0,0,0,80.4,9.9);

	this.timeline.addTween(cjs.Tween.get(this.PROJ_DEV).wait(1));

	// PROJ_DES
	this.PROJ_DES = new lib.timesheet_proj_dropdown();
	this.PROJ_DES.name = "PROJ_DES";
	this.PROJ_DES.setTransform(87.15,38.85,1,1,0,0,0,80.4,9.9);

	this.timeline.addTween(cjs.Tween.get(this.PROJ_DES).wait(1));

	// PROJ_BUS
	this.PROJ_BUS = new lib.timesheet_proj_dropdown();
	this.PROJ_BUS.name = "PROJ_BUS";
	this.PROJ_BUS.setTransform(87.15,13,1,1,0,0,0,80.4,9.9);

	this.timeline.addTween(cjs.Tween.get(this.PROJ_BUS).wait(1));

	this._renderFirstFrame();

}).prototype = getMCSymbolPrototype(lib.timesheet_project_dropdown_combined, new cjs.Rectangle(-0.5,-0.5,179.8,130.9), null);


