(lib.project_codes_combined = function(mode,startPosition,loop,reversed) {
if (loop == null) { loop = true; }
if (reversed == null) { reversed = false; }
	var props = new Object();
	props.mode = mode;
	props.startPosition = startPosition;
	props.labels = {};
	props.loop = loop;
	props.reversed = reversed;
	cjs.MovieClip.apply(this,[props]);

	this.isSingleFrame = false;
	// timeline functions:
	this.frame_0 = function() {
		if(this.isSingleFrame) {
			return;
		}
		if(this.totalFrames == 1) {
			this.isSingleFrame = true;
		}
		const mc = this;
		const project_codes = ["PROJ_BUS", "PROJ_DES", "PROJ_DEV", "PROJ_TRAIN", "PROJ_SUP"];
		const projHeight = 45;
		const startPos = mc.PROJ_BUS.y;
		var currentProjCode ="";
		var index = 0;
		
		this.getProjCode = function(){
			return currentProjCode;
		}
		
		
		this.getListOfProjects = function(){
			var tempList = [];
			mc.children.forEach(function(child){
				if(child.visible == true){
					tempList.push(child.name);
				}
			});
			return tempList;
		}
		
		this.deselectAllMenus = function() {
			mc.children.forEach(function(child) {
			   if (child.name) {
				   child.resetClickState();
				}
		   })
		}
		
		function selectProjectCode(selectedRadioName) {
		     mc.children.forEach(function(child) {
		        if (child.name) {
		            if (child.name === selectedRadioName) {
		               child.clickProjectCode();
					   currentProjCode = child.name;
		            } else {
		                child.resetClickState();
		            }
		        }
		    });
		}
		
		function hideAllProjectCodes(){
			mc.children.forEach(function(child){
				child.visible = false;
			});
		}
		
		this.showProjectCodes = function(arr){
			hideAllProjectCodes();
			arr.forEach(function(element){
				mc[element].visible = true;		
			});
			reorderListItems();
		}
		
		this.hideProjectCode = function(str){	
			mc[str].visible = false;	
			reorderListItems();
		}
		
		this.addProjectCode = function(str){
			mc[str].visible = true;	
			reorderListItems();
		}
		
		function reorderListItems(){
			var tempList = [];
			mc.children.forEach(function(child){
				if(child.visible == true){
					tempList.push(child);
				}
			});
		
			for(var i = 0; i < tempList.length; i++){
				tempList[i].y = startPos + projHeight * i; 
			}
		}
		
		this.init = function(){
			mc.children.forEach(function(child){
				child.setProjectCode(project_codes[index]);
				if (child.name) {
					child.on("click", function() {
						selectProjectCode(child.name);
					});
				}
				index++;
			});
		}
	}

	// actions tween:
	this.timeline.addTween(cjs.Tween.get(this).call(this.frame_0).wait(1));

	// Layer_1
	this.PROJ_SUP = new lib.proj_codeList();
	this.PROJ_SUP.name = "PROJ_SUP";
	this.PROJ_SUP.setTransform(87.45,205.9,1,1,0,0,0,81.4,21.9);

	this.PROJ_TRAIN = new lib.proj_codeList();
	this.PROJ_TRAIN.name = "PROJ_TRAIN";
	this.PROJ_TRAIN.setTransform(87.45,159.9,1,1,0,0,0,81.4,21.9);

	this.PROJ_DEV = new lib.proj_codeList();
	this.PROJ_DEV.name = "PROJ_DEV";
	this.PROJ_DEV.setTransform(87.45,113.9,1,1,0,0,0,81.4,21.9);

	this.PROJ_DES = new lib.proj_codeList();
	this.PROJ_DES.name = "PROJ_DES";
	this.PROJ_DES.setTransform(87.45,67.9,1,1,0,0,0,81.4,21.9);

	this.PROJ_BUS = new lib.proj_codeList();
	this.PROJ_BUS.name = "PROJ_BUS";
	this.PROJ_BUS.setTransform(87.45,21.9,1,1,0,0,0,81.4,21.9);

	this.timeline.addTween(cjs.Tween.get({}).to({state:[{t:this.PROJ_BUS},{t:this.PROJ_DES},{t:this.PROJ_DEV},{t:this.PROJ_TRAIN},{t:this.PROJ_SUP}]}).wait(1));

	this._renderFirstFrame();

}).prototype = getMCSymbolPrototype(lib.project_codes_combined, new cjs.Rectangle(0,0,168.8,227.9), null);


