		this.setTimesheetPayPeriod = function(date){	
		
			var periodStartDate = new Date(date.start);
			var periodParsed = Number(date.start.split("/")[1]);		
			timePeriodStart = date.start;
			timePeriodEnd = date.end;
			
			header.text = `Time – Timesheet for ${root.firstlast} (${timePeriodStart} - ${timePeriodEnd})`
		
			this.initialPeriodParsed = periodParsed;
			sendDataToPreviewPage();
		
			fields.forEach(function(element){
				var currentDay = periodStartDate.getDate();
		        var currentMonth = periodStartDate.getMonth() + 1;
		        var currentYear = periodStartDate.getFullYear();
		
		        mc[element].text = element.toUpperCase() + "\n" + currentDay;
		        periodStartDate.setDate(periodStartDate.getDate() + 1);
			});		
		
			mc.updateDashboardTimesheet();
		}
		
		function calculateRows(){
			
			const fieldData = mc.fieldData;
		    const days = ["mon", "tue", "wed", "thu", "fri"];
		
		
			var fieldDataCopy = JSON.parse(JSON.stringify(fieldData));  
			
			//Calculate the columns
		    days.forEach(function(day) {
		        const total = fieldData[`row_0_${day}`] + fieldData[`row_1_${day}`];
		        mc[`${day.toUpperCase()}_total`].text = total > 0 ? total : "";
				
				totals[`${day.toUpperCase()}_total`] = total.toFixed(2);
				fieldDataCopy[`row_0_${day}`] = fieldData[`row_0_${day}`].toFixed(2);
				fieldDataCopy[`row_1_${day}`] = fieldData[`row_1_${day}`].toFixed(2);	
		    });
		
		    //Calculate row totals
		    for (var i = 0; i < 2; i++) {
		        var rowTotal = 0;
		        days.forEach(function(day) {
		            rowTotal += fieldData[`row_${i}_${day}`];
					mc[`row_${i}_total`].text = rowTotal > 0 ? rowTotal : "";	
		
					totals[`row_${i}_total`] = rowTotal.toFixed(2);
		        });
		    }
		
		    const combinedTotal = (parseFloat(mc.row_0_total.text) || 0) + (parseFloat(mc.row_1_total.text) || 0);
		    mc.combined_total.text = combinedTotal > 0 ? combinedTotal : "";	
		
			totals.combined_total = combinedTotal.toFixed(2);
			preview_page.content_mc.setTimesheetData(fieldDataCopy, totals);
		}
		
