		this.updateFieldsOnShow = function() {
		    const days = ["mon", "tue", "wed", "thu", "fri"];
		
		    createjs.Ticker.addEventListener("tick", updateFields);
		
		    var foundAllFields = true;
		    var maxWaitTime = 50; 
		    var startTime = Date.now();
		
		    function updateFields() {
		        foundAllFields = true;
		
		        for (var i = 0; i < 2; i++) {
		            days.forEach(function(day) {
		                const fieldName = `row_${i}_${day}`;
		                if ($("#" + fieldName).length == 0) {
		                    foundAllFields = false;    
		                }
		            });
		        }
		
		        if (foundAllFields) {
		            const fieldData = mc.savedData;
				
					mc.fieldData = JSON.parse(JSON.stringify(mc.savedData)); //Update the original field data with save data
					calculateRows();
		
		            for (var i = 0; i < 2; i++) {
		                days.forEach(function(day) {
		                    const fieldName = `row_${i}_${day}`;
		                     var value = (fieldData[fieldName] == "0" ? "" : fieldData[fieldName]); 
		                    $("#" + fieldName).val(value);
		                });
		            }
		
		            createjs.Ticker.removeEventListener("tick", updateFields);
		        }
		        else {
		            if (Date.now() - startTime >= maxWaitTime) {
		                createjs.Ticker.removeEventListener("tick", updateFields);
		            }
		        }
		    }
		};
		
