			var menu_open = child.menu_open;
			var menu_btn = child.menu_btn;
		
		    menu_open.visible = false;
		
		    function handleMouseOut() {
		        closeTimeout = setTimeout(function(){
		            isOpen = false;
		            menu_open.visible = false;
		        }, 200); 
		    }
		
		    function handleMouseOver() {
		        clearTimeout(closeTimeout); 
		    }
		
		    // Assign event listeners
		    menu_open.addEventListener("mouseout", handleMouseOut);
		    menu_open.addEventListener("mouseover", handleMouseOver);
		
