		//-----------------------------------------------
		//	Scrollbar Functionality
		//-----------------------------------------------
		this.assignScrollbarFunction = function(mc, data){
		
			const thumb_mc = mc.thumb_mc;
			const content_mc = mc.content_mc;
			const mask_mc = mc.mask_mc;
			const up_arrow_btn = mc.up_arrow_btn;
			const down_arrow_btn = mc.down_arrow_btn;
			const track_mc = mc.track_mc;
			const yPos = content_mc.y;
		
			var thumbHeight = data.thumbHeight || 80;
			var scrollbarHeight = data.scrollbarHeight || 378;
			const thumbTopBound = thumb_mc.y;
			var thumbBottomBound = data.thumbBottomBound || 593; 
			const maskHeight = scrollbarHeight;
			var contentHeight = data.contentHeight || 499; 
		
			var scrollSpeed = data.scrollSpeed || 50;
			var scrollInterval = data.scrollInterval || 50; 
		
			mc.resetScrollbar = function() {
				thumb_mc.y = thumbTopBound; 
				updateContentPosition();    
			}
		
			function updateContentPosition() {
				const scrollPercent = (thumb_mc.y - thumbTopBound) / (thumbBottomBound - thumbTopBound);
				content_mc.y = yPos - scrollPercent * (contentHeight - maskHeight);
			}
		
			thumb_mc.on("pressmove", function(event) {
				let newY = event.stageY - thumbHeight / 2;
		
				if (newY < thumbTopBound) {
					newY = thumbTopBound;
				} else if (newY > thumbBottomBound) {
					newY = thumbBottomBound;
				}
		
				thumb_mc.y = newY;
				updateContentPosition();
			});
		
			function startScroll(direction) {
				return setInterval(function() {
					if (direction === "up") {
						thumb_mc.y -= scrollSpeed;
						if (thumb_mc.y < thumbTopBound) thumb_mc.y = thumbTopBound;
					} else if (direction === "down") {
						thumb_mc.y += scrollSpeed;
						if (thumb_mc.y > thumbBottomBound) thumb_mc.y = thumbBottomBound;
					}
					updateContentPosition();
				}, scrollInterval);
			}
		
			up_arrow_btn.on("mousedown", handleMouseDown);
			down_arrow_btn.on("mousedown", handleMouseDown);
			up_arrow_btn.on("pressup", handleMouseUp);
			down_arrow_btn.on("pressup", handleMouseUp);
		
			function handleMouseDown(event) {
				const direction = event.currentTarget.name.includes("up") ? "up" : "down";
				scrollIntervalId = startScroll(direction);
			}
		
			function handleMouseUp() {
				clearInterval(scrollIntervalId);
			}
		
			track_mc.on("mousedown", function(event) {
				const mouseY = event.stageY;
				const thumbCenter = thumb_mc.y + thumbHeight / 2;
				
				if (mouseY < thumbCenter) {
					thumb_mc.y -= scrollSpeed;
					if (thumb_mc.y < thumbTopBound) thumb_mc.y = thumbTopBound;
				} else {
					thumb_mc.y += scrollSpeed;
					if (thumb_mc.y > thumbBottomBound) thumb_mc.y = thumbBottomBound;
				}
		
				updateContentPosition();
			});
		
			content_mc.addEventListener("mouseover", function() {
				stage.canvas.addEventListener("wheel", handleScroll, { passive: false });
			});
		
			content_mc.addEventListener("mouseout", function() {
				stage.canvas.removeEventListener("wheel", handleScroll, { passive: false });
			});
		
			function handleScroll(event) {
		
				event.preventDefault(); 
				
				var delta = event.deltaY;
		
				if (delta > 0) {
					thumb_mc.y += scrollSpeed;
					if (thumb_mc.y > thumbBottomBound) thumb_mc.y = thumbBottomBound;
				}
				else if (delta < 0) {
					thumb_mc.y -= scrollSpeed;
					if (thumb_mc.y < thumbTopBound) thumb_mc.y = thumbTopBound;
				}
		
				updateContentPosition();		
			}
		
		}
		
		
