		this.getCurrentDateTime = function(daysToSubtract, randomizeTime) {
		    const now = new Date();
		
			if(daysToSubtract !== undefined){
				now.setDate(now.getDate() - daysToSubtract);
			}
		    
			var hours, minutes;
		
		    if (randomizeTime) {
		        hour = Math.floor(Math.random() * (17 - 8 + 1)) + 8;
		        minutes = Math.floor(Math.random() * 60);
		    } else {
		        hour = now.getHours(); 
		        minutes = now.getMinutes();
		    }
		
		    const month = now.getMonth() + 1;
		    const day = now.getDate();
		    const year = now.getFullYear();
		        
		    const amPm = hour >= 12 ? 'PM' : 'AM';
		    
		    hour = hour % 12 || 12; 
		
		    const formattedMinutes = minutes < 10 ? `0${minutes}` : minutes;
		    return `${month}/${day}/${year} ${hour}:${formattedMinutes} ${amPm}`;
		}
		
		this.getSubmittedPayPeriod = function(){
		
			const threeWeeksPriorDate =  getDateFormattedDate(21);
			const threeWeeksPriorData = getPayPeriod(threeWeeksPriorDate);
			const threeWeeksPriorDateTime = this.getCurrentDateTime(21, true);
		
			const data = {
							timePeriod : threeWeeksPriorData.start + " - " +  threeWeeksPriorData.end,
							currentDayTime : threeWeeksPriorDateTime
						 }
			
			return data;
		 }
		
		
		this.setCurrentPayPeriod = function(date){
		 	var inuseTimesheetData = getPayPeriod(date);
			this.time_current_page.setTimesheetPayPeriod(inuseTimesheetData);
		}
		
		function getPayPeriod(dateString) {
		    var date;
		    
		    if (dateString) {
				 const [month, day, year] = dateString.split('/').map(Number);
		         date = new Date(year, month - 1, day);
		    } else {
		        date = new Date();
		    }
		    
		    const dayOfWeek = date.getDay();
		    const daysSinceSaturday = (dayOfWeek + 1) % 7;
		    
		    const startOfPayPeriod = new Date(date);
		    startOfPayPeriod.setDate(date.getDate() - daysSinceSaturday);
		    
		    const endOfPayPeriod = new Date(startOfPayPeriod);
		    endOfPayPeriod.setDate(startOfPayPeriod.getDate() + 6);
		
		    function formatDate(d) {
		        return `${d.getMonth() + 1}/${d.getDate()}/${d.getFullYear()}`;
		    }
		
		    return {
		        start: formatDate(startOfPayPeriod),
		        end: formatDate(endOfPayPeriod),
		        currentDay: formatDate(date)
		    };
		}
		
		this.getCorrectPayPeriod = function() {
		    const date = new Date();
		    const dayOfWeek = date.getDay();
		    
		    const daysSinceLastSaturday = (dayOfWeek + 1) % 7 + 7;
		    const startOfPayPeriod = new Date(date);
		    startOfPayPeriod.setDate(date.getDate() - daysSinceLastSaturday);
		
		    const endOfPayPeriod = new Date(startOfPayPeriod);
		    endOfPayPeriod.setDate(startOfPayPeriod.getDate() + 6);
		
		    function formatDate(d) {
		        return `${d.getMonth() + 1}/${d.getDate()}/${d.getFullYear()}`;
		    }
		    
		    return {
		        start: formatDate(startOfPayPeriod),
		        end: formatDate(endOfPayPeriod),
		        startDate: startOfPayPeriod,
		        endDate: endOfPayPeriod
		    };
		}
		
		this.isDateInPayPeriod = function(selectedDate) {
			 const { startDate, endDate } = this.getCorrectPayPeriod();
		    
		    const selected = new Date(selectedDate);
		    selected.setHours(0, 0, 0, 0);
		    
		    const start = new Date(startDate);
		    const end = new Date(endDate);
		    
		    start.setHours(0, 0, 0, 0);
		    end.setHours(0, 0, 0, 0);
		    
		    return selected >= start && selected <= end;
		};
		
		function getDateFormattedDate(daysToSubtract) {
		
			const date = new Date();
			
			if(daysToSubtract !== undefined){
				date.setDate(date.getDate() - daysToSubtract);
			}
		
		    function formatDate(d) {
		        return `${d.getMonth() + 1}/${d.getDate()}/${d.getFullYear()}`;
		    }
		
		    return formatDate(date);
		}
		
