		function checkMCsReady() {
		
			const pagesDuplicate = pages.concat();
			pagesDuplicate.push("content_container");
			pagesDuplicate.push("menus");
			pagesDuplicate.push("scenario_overview");
			pagesDuplicate.push("web_email_page");
		
		    allMCsReady = true;
		
		    for (var i = 0; i < pagesDuplicate.length; i++) {		
		        if (mc[pagesDuplicate[i]] && !mc[pagesDuplicate[i]].isReady) {
		            allMCsReady = false; 
		            break; 
		        }
		    }
		
		    if (allMCsReady) {
		
				createjs.Ticker.removeEventListener("tick", checkMCsReady);
		
				//Initalize all page methods
				pagesDuplicate.forEach(function(child){
					if(mc[child]){
						mc[child].init();
					}
				});	
				
		 			
				mc.activePage = "web_email_page" 
				mc.unlockAllMenus();
				
				window.pageFinishedLoading();
		
				mc.finish_assessment_popup.visible = false;
				mc.results_page.visible = false;
				mc.error_message.visible = false;
				mc.showPage(mc.activePage);
				mc.content_container.setActiveScenario("assessment");	
		
		     }else {
				// Check if we've exceeded the maximum wait time
				if (Date.now() - startTime >= maxWaitTime) {
					createjs.Ticker.removeEventListener("tick", checkMCsReady);
					displayLoadingError();
				}
			}
		}
		
		function displayLoadingError(){
			mc.error_message.visible = true;
			mc.scenario_overview.visible = false;
			mc.stage.mouseEnabled = false;
		}
		
		this.init = function(){
			createjs.Ticker.addEventListener("tick", checkMCsReady);
		}
		
